import time

class Solution:
    def lengthOfLongestSubstring(self, s):
        """
        :type s: str
        :rtype: int
        """
        start = 0
        end = 0
        maxLen = 0
        char_set = set()

        while end < len(s):
            if s[end] not in char_set:
                char_set.add(s[end])
                end += 1
                maxLen = max(maxLen, end - start)
            else:
                char_set.remove(s[start])
                start += 1
        
        return maxLen

